// })
function cardarray(){
    var i;
    for(i=0;i<robots.length;i++)
    {
         <Card id={robots[i].id} name={robots[i].name} email={robots[i].email} />

    }
}
     return (

         <div>
          {cardarray}
         </div>
     );
 }
 export default Card_List;
